As I am thinking about summer, I wanted to share an image I captured in July while on a day trip over Phantom Canyon Road.  As we were driving by this thistle plant I noticed a few Tiger Swallow Tail Butterflies fluttering on the flower. I found a pull off and walked back to the edge of the road, and was happy to see that the butterflies were still there.  While I approached I noticed there were 6-7 of them in the immediate area.  I spent about half an hour watching and taking pictures; trying to get a shot with more than one butterfly on the flower.  I appreciate Abby keeping Logan entertained while I was taking pictures.  As this was his first day trip with me and my camera, he got a taste of future adventures that include random stops along the road to take pictures!  Hopefully he gets used to them!

